pragma solidity ^0.4.23;

import "zeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "zeppelin-solidity/contracts/math/SafeMath.sol";

/**      
@title TokenReceiver interface 
@author Entity Protocol
@dev Provides methods to transfer ERC20 tokens to this contract if senders 
     authorize this contract to act on there behalf. Provides book keeping
     for the amount of tokens "locked" into the contract for each sender.
 */         
contract TokenReceiver { 
    using SafeMath for uint256;

    /**
    @dev Address of the ERC20 contract
     */
    address public tokenAddress;

    /**
    @dev Mapping of senders to how much has been transfered on
         there behalf. 
    */
    mapping(address => uint256) private deposits; 


    /**
    @dev Gets the total value held in this contract 
    */
    uint256 private totalDepositedValue; 

    event Deposited(address owner, uint256 value, uint256 currentDeposit);
    event Attributed(address owner, uint256 value, uint256 currentDeposit);
    event Withdraw(address owner, uint256 value, uint256 currentDeposit);
    event Transfer(address from, address to, uint256 value, uint fromCurrentDeposit, uint toCurrentDeposit);

    /**
    @notice Constructor for TokenReciver
    @param _tokenAddress ERC20 contract address that deposits and withdrawls will be executed via.
    */
    constructor(address _tokenAddress) public { 
        checkERC20Contract(_tokenAddress);
        tokenAddress = _tokenAddress;
    }

    function _unattributedTokenValue() internal view returns (uint256 _value) { 
        ERC20 token = ERC20(tokenAddress);
        uint256 erc20balance = token.balanceOf(address(this));

        if(erc20balance <= 0) {
            return 0;
        }

        return erc20balance.sub(totalDepositedValue);
    }

    function depositBalanceOf(address _address) public view returns (uint256 _value) { 
        return deposits[_address];
    }

    function _attributeUnowned(address owner, uint256 _value) internal returns (bool _success) { 
        require(_value > 0, "Attribution value must be non-zero");

        uint256 unattributedTokenValue = _unattributedTokenValue();

        require(_value <= unattributedTokenValue, "Attribution of tokens must be less than the unattributed value assigned to this contract");
        require(_attribute(owner, _value), "Token attribution must be successful");

        emit Attributed(owner, _value, depositBalanceOf(owner));
        return true;
    }

    function _depositHere(uint256 _value) internal returns (bool _result) { 
        ERC20 token = ERC20(tokenAddress);

        require(token.balanceOf(msg.sender) >= _value, "Sender must have a token value greater than or equal to the deposit value.");
        require(token.transferFrom(msg.sender, address(this), _value), "Token transfer to contract must be successful.");

        require(_attribute(msg.sender, _value), "Token attribution must be successful");

        emit Deposited(msg.sender, _value, depositBalanceOf(msg.sender));
        return true; 
    }

    function _attribute(address owner, uint256 _value) internal returns (bool _result) { 
        deposits[owner] = deposits[owner].add(_value);
        totalDepositedValue = totalDepositedValue.add(_value);
        return true;
    }

    function _withdrawTo(address _address, uint256 _value) internal returns (bool _result) { 
        require(_address != address(0), "Destination address must be non zero.");
        require(deposits[_address] >= _value, "Destination address must have deposited atleast the withdrawl value.");

        ERC20 token = ERC20(tokenAddress);

        token.transfer(_address, _value);
        deposits[_address] = deposits[_address].sub(_value);
        totalDepositedValue = totalDepositedValue.sub(_value);

        emit Withdraw(_address, _value, depositBalanceOf(_address));
        return true; 
    }

    function _transferDeposit(address _from, address _to, uint256 _value) internal returns (bool _result) { 
        require(_from != address(0), "Origin address must be non zero.");
        require(_to != address(0), "Destination address must be non zero.");
        require(_from != _to, "Origin and destination address must not be the same.");
        require(deposits[_from] >= _value, "Origin address must have deposited atleast the transfer value.");

        deposits[_from] = deposits[_from].sub(_value);
        deposits[_to] = deposits[_to].add(_value);

        emit Transfer(_from, _to, _value, depositBalanceOf(_from), depositBalanceOf(_to));
        return true;
    }

    function _getTotalTokenValue() internal view returns (uint256 _value) { 
        return totalDepositedValue;
    }

    /**
    @dev Attempts to check if the specified address is a valid ERC20 contract
         by checking that ERC20.totalSupply can be called. Will throw on
         failure. 
    @param _address Address of contract. 
    */
    function checkERC20Contract(address _address) private view { 
        require(_address != address(0), "Token contract address must be non zero.");
        ERC20 token = ERC20(_address);

        // TODO - these are the only callable function that we can pass
        // no parameters into, we should get a runtime exception if this
        // fails, guarding against setting to invalid addresses.
        // EIP 881 will give a way for querying supported contracts
        require(token.totalSupply() > 0);
    }
}

